const KreirajMaterijal = () => {
  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(kime);
  };
  return (
    <form onSubmit={handleSubmit}>
      <label>
        <p>Korisničko ime:</p>
        <input
          type="text"
          name="kime"
          placeholder="Korisničko ime"
          id="kime"
          value={kime}
          onChange={handleKime}
        />
      </label>

      <label>
        <p>Lozinka:</p>
        <input
          type="text"
          name="lozinka"
          placeholder="Lozinka"
          id="lozinka"
          value={lozinka}
          onChange={handleLozinka}
        />
      </label>
      <button type="submit">Prijava</button>
    </form>
  );
};

export default KreirajMaterijal;
